ction from applying.'=>'O PayPal permite-nos enviar apenas um endereço. Se está a utilizar o PayPal para etiquetas de envio, talvez prefira enviar a morada de entrega em vez da de faturação. Ao desativar pode estar a impedir que se aplique a proteção de vendedor do PayPal.','%s field'=>'Campo %s','%s page'=>'página %s','Account details:'=>'Detalhes da conta:','Any &quot;%1$s&quot; method'=>'Qualquer método &quot;%1$s&quot;','%1$s (#%2$s)'=>'%1$s (#%2$s)','%1$s &ndash; %2$s'=>'%1$s &ndash; %2$s','Comma-separated list of search stopwords in your languageabout,an,are,as,at,be,by,com,for,from,how,in,is,it,of,on,or,that,the,this,to,was,what,when,where,who,will,with,www'=>'a,ao,as,à,às,com,como,da,das,de,do,dos,e,em,eu,ela,ele,eles,esse,está,foi,há,isso,isto,já,mas,me,meu,muito,na,nas,o,ou,pelo,pela,seu,sua,quando','Other locations'=>'Outras localizações','Take payments in person via checks. This offline gateway can also be useful to test purchases.'=>'Receba pagamentos por cheque. Este método de pagamento offline por ser útil para compras de teste.','Optionally add some text for the terms checkbox that customers must accept.'=>'Opcionalmente, adicione algum texto à caixa de verificação dos termos e condições que os clientes deverão aceitar.','No page set'=>'Sem página definida','Highlight required fields with an asterisk'=>'Realçar campos obrigatórios com um asterisco','Required'=>'Obrigatório','Please see the <a href="https://www.paypal.com/us/webapps/mpp/ua/privacy-full">PayPal Privacy Policy</a> for more details.'=>'Por favor veja a <a href="https://www.paypal.com/us/webapps/mpp/ua/privacy-full">Política de Privacidade do PayPal</a> para mais informações.','We accept payments through PayPal. When processing payments, some of your data will be passed to PayPal, including information required to process or support the payment, such as the purchase total and billing information.'=>'Aceitamos pagamentos via PayPal. Ao processar os pagamentos, alguns dos seus dados são enviados ao PayPal, sendo informação necessária para processar e gerir o pagamento, como o total da encomenda e a informação de faturação.','PayPal Standard redirects customers to PayPal to enter their payment information.'=>'O PayPal Standard redireciona os clientes para o PayPal para introduzirem as informações de pagamento.','Take payments in person via BACS. More commonly known as direct bank/wire transfer.'=>'Receba pagamentos por transferência bancária.','I have read and agree to the website %s'=>'Li e aceito os %s da loja','These options let you change the appearance of the WooCommerce checkout.'=>'Estas opções permitem alterar a apresentação da finalização de compra do WooCommerce.','In this subsection you should list which third party payment processors you’re using to take payments on your store since these may handle customer data. We’ve included PayPal as an example, but you should remove this if you’re not using PayPal.'=>'Nesta subsecção, deve listar os processadores de pagamento de terceiros que utiliza para efetuar pagamentos na sua loja, uma vez que estes podem manipular os dados do cliente. Nós incluímos o PayPal como um exemplo, deverá removê-lo se não estiver a utilizar o PayPal.','We share information with third parties who help us provide our orders and store services to you; for example --'=>'Partilhamos informações com terceiros que nos ajudam a processar as suas encomendas; por exemplo --','In this section you should list who you’re sharing data with, and for what purpose. This could include, but may not be limited to, analytics, marketing, payment gateways, shipping providers, and third party embeds.'=>'Nesta secção, deve listar com quem você partilha os dados e com que finalidade. Isso pode incluir, mas não pode ser limitado a, Analytics, marketing, plataformas de pagamento, fornecedores de transporte e integrações de terceiros.','What we share with others'=>'O que partilhamos com outros','Order information like what was purchased, when it was purchased and where it should be sent, and'=>'Informações da encomenda, o que comprou, quando comprou e para onde será enviar, e','Members of our team have access to the information you provide us. For example, both Administrators and Shop Managers can access:'=>'Os membros da nossa equipa tem acesso a informação que nos fornece. Por exemplo, os administradores e gestores de loja podem aceder a:','Who on our team has access'=>'Quem na nossa equipa tem acesso','We will also store comments or reviews, if you choose to leave them.'=>'Guardamos comentários ou avaliações.','Our team members have access to this information to help fulfill orders, process refunds and support you.'=>'Os membros da nossa equipa têm acesso a esta informação para satisfazer encomendas, processar devoluções e apoio ao cliente.','Customer information like your name, email address, and billing and shipping information.'=>'As informações do cliente como o nome, email e morada de faturação e envio.','We generally store information about you for as long as we need the information for the purposes for which we collect and use it, and we are not legally required to continue to keep it. For example, we will store order information for XXX years for tax and accounting purposes. This includes your name, email address and billing and shipping addresses.'=>'Em geral, armazenamos informações sobre si enquanto precisamos desses dados para os motivos que os coletamos, e não somos obrigados, por lei, a continuar a mantê-los. Por exemplo, armazenaremos informações por XXX anos para fins fiscais e contabilísticos. Isso inclui o seu nome, endereço de email, morada de faturação e envio.','If you create an account, we will store your name, address, email and phone number, which will be used to populate the checkout for future orders.'=>'Se criar uma conta, guardamos o seu nome, morada, email e número de telefone, que serão utilizados para preencher os seus dados nas próximas encomendas.','Send you marketing messages, if you choose to receive them'=>'Enviar-lhe mensagens de marketing, se desejar recebe-las','Improve our store offerings'=>'Melhorar as ofertas da nossa loja','Comply with any legal obligations we have, such as calculating taxes'=>'Cumprir todas as obrigações legais que temos, como o cálculo de impostos','Set up your account for our store'=>'Configure a sua conta para a nossa loja','Process payments and prevent fraud'=>'Processamento de pagamentos e prevenção de fraude','Respond to your requests, including refunds and complaints'=>'Responder aos seus pedidos, incluindo reembolsos e queixas','Send you information about your account and order'=>'Enviar-lhe informações sobre a sua conta e encomenda','When you purchase from us, we’ll ask you to provide information including your name, billing address, shipping address, email address, phone number, credit card/payment details and optional account information like username and password. We’ll use this information for purposes, such as, to:'=>'Ao comprar na nossa loja, serão pedidas informações como o seu nome, endereço de faturação, endereço de envio, endereço de email, número de telefone, detalhes do cartão de crédito e de pagamento, e outras informações opcionais da sua conta, como utilizador e senha. Estas informações serão utilizadas para fins como:','Note: you may want to further detail your cookie policy, and link to that section from here.'=>'Nota: poderá querer detalhar mais a sua política de cookies, e link para essa secção a partir daqui.','We’ll also use cookies to keep track of cart contents while you’re browsing our site.'=>'Também utilizamos cookies para manter o conteúdo do carrinho enquanto navega no nosso site.','Shipping address: we’ll ask you to enter this so we can, for instance, estimate shipping before you place an order, and send you the order!'=>'Morada de envio: iremos pedir-lhe para, por exemplo, estimar os custos de transporte antes de efetuar uma encomenda!','Location, IP address and browser type: we’ll use this for purposes like estimating taxes and shipping'=>'Localização, endereço IP e tipo de navegador: utilizaremos para estimativa de impostos e transporte','Products you’ve viewed: we’ll use this to, for example, show you products you’ve recently viewed'=>'Produtos que visualizou: utilizaremos isto, por exemplo, para mostrar produtos que tenha visto recentemente','While you visit our site, we’ll track:'=>'Enquanto você visita o nosso site, vamos registar:','What we collect and store'=>'O que recolhemos e armazenamos','This sample language includes the basics around what personal data your store may be collecting, storing and sharing, as well as who may have access to that data. Depending on what settings are enabled and which additional plugins are used, the specific information shared by your store will vary. We recommend consulting with a lawyer when deciding what information to disclose on your privacy policy.'=>'Este exemplo inclui o básico relativamente aos dados pessoais que a sua loja poderá estar a coletar, armazenar e partilhar, bem como quem pode ter acesso a esses dados. Dependendo das configurações ativas e quais plugins adicionais são utilizados, as informações específicas partilhadas pela sua loja irão variar. Recomendamos consultoria com um advogado ao decidir quais informações divulgar na sua política de privacidade.','We collect information about you during the checkout process on our store.'=>'Recolhemos informações sobre si durante o processo de finalização de compra na nossa loja.','Browser User Agent'=>'Agente do navegador do utilizador','Access granted'=>'Acesso permitido','Token'=>'Token','Payment Tokens'=>'Tokens de pagamento','Download count'=>'Contagem de descarregamentos','User email'=>'Email do utilizador','Order Number'=>'Número da encomenda','Items Purchased'=>'Produtos comprados','Blog id of the record on the multisite.'=>'ID do blog no registo de multisite.','%d permissions deleted'=>'%d permissões eliminadas','Display name cannot be changed to email address due to privacy concern.'=>'O nome de exibição não pode ser alterado para endereço de email por questões de privacidade.','Access to Purchased Downloads'=>'Acesso a descarregamentos comprados','display name%1$s %2$s'=>'%1$s %2$s','Download ID'=>'ID do descarregamento','Purchased Downloads'=>'Descarregamentos comprados','Customer Data'=>'Dados do cliente','Removed payment token "%d"'=>'Token de pagamento removido "%d"','Personal data removed.'=>'Dados pessoais removidos.','Customer download permissions have been retained.'=>'As permissões de descarregamento do cliente foram mantidas.','Removed access to downloadable files.'=>'Acesso removido para ficheiros descarregáveis.','Personal data within order %s has been retained.'=>'Os dados pessoais da encomenda %s foram mantidos.','Removed personal data from order %s.'=>'Removidos dados pessoais da encomenda %s.','Removed customer "%s"'=>'Removido cliente “%s”','Shipping State'=>'Distrito de envio','Shipping Postal/Zip Code'=>'Código postal de envio','Shipping City'=>'Cidade de envio','Shipping Company'=>'Empresa de envio','Phone Number'=>'Número de telefone','Error during status transition.'=>'Erro durante a transição de estado.','Payment complete event failed.'=>'Evento de pagamento completo falhou.','User roleCustomer'=>'Cliente','optional'=>'opcional','Unable to create order.'=>'Não foi possível criar a encomenda.','Please read and accept the terms and conditions to proceed with your order.'=>'Por favor leia e aceite os termos e condições para proceder com a sua encomenda.','Unserializing instances of this class is forbidden.'=>'Não é permitida a exclusão de instâncias da classe.','Cloning is forbidden.'=>'A clonagem está proibida.','This tool will delete expired download permissions and permissions with 0 remaining downloads.'=>'Essa ferramenta irá eliminar permissões de descarregamento expiradas e permissões com 0 descarregamentos restantes.','Clean up download permissions'=>'Limpar permissões de descarregamento','Used-up download permissions'=>'Permissões de descarregamento utilizadas','If the payment was refunded via the API.'=>'Se o pagamento foi devolvido via API.','Order total formatted for locale'=>'Total da encomenda formatado para o local','Name of the customer for the order'=>'Nome do cliente para a encomenda','URL to edit the order'=>'URL para editar a encomenda','%1$s has been removed from your cart because it has since been modified. You can add it back to your cart <a href="%2$s">here</a>.'=>'%1$s foi removido do seu carrinho porque foi modificado desde que o adicionou. Você poderá adicionar ao carrinho de novo <a href="%2$s">aqui</a>.','Limit result set to products with a specific attribute. Use the taxonomy name/attribute slug.'=>'Limitar o conjunto de resultados a produtos atribuídos a um ID de termo de atributo especifico (obrigatório a atribuição de um atributo).','Billing State'=>'Distrito de faturação','Billing Postal/Zip Code'=>'Código postal de faturação','Billing City'=>'Cidade de faturação','Billing Company'=>'Empresa de faturação','Update status event failed.'=>'Evento de atualização de estado falhou.','Deleted all active sessions, and %d saved carts.'=>'Eliminadas todas as sessões ativas e %d carrinhos guardados.','This tool will delete all customer session data from the database, including current carts and saved carts in the database.'=>'Esta ferramenta irá eliminar todos os dados de sessão do cliente da base de dados, incluindo carrinhos de compras atuais e gravados na base de dados.','Your store does not appear to be using a secure connection. We highly recommend serving your entire website over an HTTPS connection to help keep customer data secure. <a href="%s">Learn more here.</a>'=>'A sua loja não parece estar a utilizar uma ligação segura. Recomendamos que ative um certificado SSL e sirva o seu website via HTTPS de forma a manter os dados dos clientes seguros. <a href="%s">Leia mais aqui.</a>','Shipping Last Name'=>'Apelido de envio','Shipping First Name'=>'Nome de envio','Billing Last Name'=>'Apelido da faturação','Billing First Name'=>'Nome de faturação','User roleShop manager'=>'Gestor de loja','Display name'=>'Nome a mostrar','WooCommerce pages'=>'Páginas WooCommerce','WooCommerce database version'=>'Versão da base de dados do WooCommerce','Pending orders are unpaid and may have been abandoned by the customer. They will be trashed after the specified duration.'=>'As encomendas pendentes não foram pagas e podem ter sido abandonadas pelo cliente. Serão eliminadas após a duração especificada.','Failed orders are unpaid and may have been abandoned by the customer. They will be trashed after the specified duration.'=>'As encomendas falhadas não foram pagas e podem ter sido abandonadas pelo cliente. Serão eliminadas após a duração especificada.','%1$s - There is a newer version of WordPress available (%2$s)'=>'%1$s . Há uma nova versão do WordPress disponível (%2$s)','WordPress cron'=>'Tarefas agendadas do WordPress','WordPress debug mode'=>'Modo de depuração do WordPress','WordPress memory limit'=>'Limite de memória do WordPress','WordPress multisite'=>'WordPress multisite','WordPress version'=>'Versão do WordPress','Settings tab labelPayments'=>'Pagamentos','Enable coupons'=>'Permitir o uso de cupões','Manage'=>'Gerir','Secure checkout'=>'Forçar finalizar compra segura','Legacy API'=>'API obsoleta','Retain completed orders for a specified duration before anonymizing the personal data within them.'=>'Reter encomendas concluídas por uma duração especificada antes de anonimizar os dados pessoais.','Retain completed orders'=>'Reter encomendas concluídas','Retain cancelled orders'=>'Reter encomendas canceladas','Retain failed orders'=>'Reter encomendas falhadas','Displays whether or not WordPress is using an external object cache.'=>'Mostra se o WordPress está a utilizar cache de objetos externa.','External object cache'=>'Cache de objetos externa','Enable tax rates and calculations'=>'Ativar taxas e cálculos de impostos','Account endpoints'=>'Endpoints da conta','WooCommerce version'=>'Versão do WooCommerce','Rates will be configurable and taxes will be calculated during checkout.'=>'As taxas são configuráveis e o imposto a pagar é calculado na finalização da compra.','Cancelled orders are unpaid and may have been cancelled by the store owner or customer. They will be trashed after the specified duration.'=>'As encomendas canceladas não foram pagas e podem ter sido canceladas pelo gestor ou cliente da loja. Serão movidas para o lixo após o prazo especificado.','Allowed emails'=>'E-mails permitidos','Accounts &amp; Privacy'=>'Contas e privacidade','Account erasure requests'=>'Pedidos de eliminação de conta','Choose how long to retain personal data when it\'s no longer needed for processing. Leave the following options blank to retain this data indefinitely.'=>'Escolha quanto tempo quer reter dados pessoais quando não forem mais necessários para o processamento da encomenda. Deixe as seguintes opções em branco para reter esses dados indefinidamente.','Personal data retention'=>'Retenção de dados pessoais','Your personal data will be used to process your order, support your experience throughout this website, and for other purposes described in our %s.'=>'Os seus dados pessoais serão utilizados para processar a sua encomenda, para melhorar a sua experiência em toda a loja e para os propósitos descritos na nossa %s.','Optionally add some text about your store privacy policy to show during checkout.'=>'Opcionalmente, adicione algum texto sobre a sua política de privacidade para mostrar durante a finalização da compra.','Checkout privacy policy'=>'Política de privacidade na finalização da compra','Your personal data will be used to support your experience throughout this website, to manage access to your account, and for other purposes described in our %s.'=>'Os seus dados pessoais serão utilizados para melhorar a sua experiência por toda a loja, para gerir o acesso à sua conta e para os propósitos descritos na nossa %s.','Optionally add some text about your store privacy policy to show on account registration forms.'=>'Opcionalmente, adicione algum texto sobre a sua política de privacidade para mostrar nos formulários de registo de conta.','Registration privacy policy'=>'Política de privacidade no registo','Privacy policy'=>'Política de privacidade','Filter by registered customer'=>'Filtrar por cliente registado','Remove personal data'=>'Remover dados pessoais','Use previous column mapping preferences?'=>'Utilizar configurações de mapeamento de colunas anterior?','Inactive accounts are those which have not logged in, or placed an order, for the specified duration. They will be deleted. Any orders will be converted into guest orders.'=>'Contas inativas são aquelas que não iniciaram sessão ou efetuaram uma encomenda, no período especificado. Serão apagadas. Todas as encomendas serão convertidas em encomendas de visitante.','Retain pending orders '=>'Reter encomendas pendentes ','Retain inactive accounts '=>'Reter contas inativas ','privacy page'=>'página da política de privacidade','This section controls the display of your website privacy policy. The privacy notices below will not show up unless a %s is set.'=>'Esta secção controla a exibição da política de privacidade do seu site. As mensagens em baixo não serão exibidas a não ser que uma %s esteja definida.','List of allowed billing emails to check against when an order is placed. Separate email addresses with commas. You can also use an asterisk (*) to match parts of an email. For example "*@gmail.com" would match all gmail addresses.'=>'Lista de e-mails de faturação permitidos a verificar quando uma encomenda é feita. Separe endereços de emails com vírgulas. Também pode usar um asterisco (*) para corresponder partes de um email. Por exemplo, "*@gmail.com" corresponde a todos os endereços do Gmail.','Removed personal data from %s order.